css:
body {
  font-size: 12px;
  color: #555555;
  background-color: #ffffff;
}
atom-pane {
  border-right: 1px solid rgba(0, 0, 0, 0.22);
}
atom-pane:last-child {
  border-right: none;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar {
  width: 12px;
  height: 12px;
  background: #eeeeee;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-track,
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-corner {
  background: #eeeeee;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb {
  background: #555555;
  border: 3px solid #eeeeee;
  border-radius: 4px;
  box-shadow: none !important;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:hover,
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:active {
  background: #333333;
}
.btn {
  color: #555555;
  background-color: #ffffff;
}
.btn:hover,
.btn:focus {
  color: #333333;
  background-color: #ffffff;
}
.btn:active {
  color: #ffffff;
  background-color: #f0544c;
}
.btn.selected {
  color: #ffffff;
  background-color: #f0544c;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn.btn-primary {
  color: #ffffff;
  background-color: #03a9f4;
}
.btn.btn-primary:hover,
.btn.btn-primary:focus {
  background-color: #0fb2fc;
}
.btn.btn-primary:active {
  background-color: #039be0;
}
.btn.btn-primary.selected {
  background-color: #0fb2fc;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #23b9fc;
}
.btn.btn-info {
  color: #ffffff;
  background-color: #03a9f4;
}
.btn.btn-info:hover,
.btn.btn-info:focus {
  background-color: #0fb2fc;
}
.btn.btn-info:active {
  background-color: #039be0;
}
.btn.btn-info.selected {
  background-color: #0fb2fc;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #23b9fc;
}
.btn.btn-success {
  color: #ffffff;
  background-color: #4caf50;
}
.btn.btn-success:hover,
.btn.btn-success:focus {
  background-color: #59b75c;
}
.btn.btn-success:active {
  background-color: #46a149;
}
.btn.btn-success.selected {
  background-color: #59b75c;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #67bd6a;
}
.btn.btn-warning {
  color: #ffffff;
  background-color: #ef6c00;
}
.btn.btn-warning:hover,
.btn.btn-warning:focus {
  background-color: #ff7604;
}
.btn.btn-warning:active {
  background-color: #db6300;
}
.btn.btn-warning.selected {
  background-color: #ff7604;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #ff8119;
}
.btn.btn-error {
  color: #ffffff;
  background-color: #f44336;
}
.btn.btn-error:hover,
.btn.btn-error:focus {
  background-color: #f55549;
}
.btn.btn-error:active {
  background-color: #f33123;
}
.btn.btn-error.selected {
  background-color: #f55549;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #f6675d;
}
.btn-group > .btn {
  border-color: rgba(0, 0, 0, 0.2);
}
atom-text-editor[mini] {
  padding-left: 2.5px;
  color: #555555;
  border-color: rgba(0, 0, 0, 0.22);
  border-radius: 2px;
  background-color: #ffffff;
}
atom-text-editor[mini] .editor .placeholder-text {
  color: #999999;
}
atom-text-editor[mini] .editor .selection .region {
  background-color: #f0544c;
}
.settings-view .section atom-text-editor[mini] {
  opacity: 1;
}
.find-and-replace {
  border-top: 1px solid rgba(0, 0, 0, 0.22);
}
.tree-view .file.status {
  color: #555555;
}
.tree-view .file.status-added {
  color: #4caf50;
}
.tree-view .file.status-ignored {
  color: #999999;
}
.tree-view .file.status-modified {
  color: #ef6c00;
}
.tree-view .file.status-removed {
  color: #f44336;
}
.tree-view .file.status-renamed {
  color: #3f51b5;
}
.tree-view .directory.status > .header {
  color: #555555;
}
.tree-view .directory.status-added > .header {
  color: #4caf50;
}
.tree-view .directory.status-ignored > .header {
  color: #999999;
}
.tree-view .directory.status-modified > .header {
  color: #ef6c00;
}
.tree-view .directory.status-removed > .header {
  color: #f44336;
}
.tree-view .directory.status-renamed > .header {
  color: #3f51b5;
}
.tab-bar .status {
  color: #555555;
}
.tab-bar .status-added {
  color: #4caf50;
}
.tab-bar .status-ignored {
  color: #999999;
}
.tab-bar .status-modified {
  color: #ef6c00;
}
.tab-bar .status-removed {
  color: #f44336;
}
.tab-bar .status-renamed {
  color: #3f51b5;
}
.git-control .files .file.deleted,
.git-control .files .allfiles.deleted {
  color: rgba(85, 85, 85, 0.005);
}
.git-control .files .file.modified,
.git-control .files .allfiles.modified {
  color: #ef6c00;
}
.git-control .files .file.new,
.git-control .files .allfiles.new {
  color: #4caf50;
}
.git-control .files .file.conflict,
.git-control .files .allfiles.conflict {
  color: #f44336;
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 2.5px;
  line-height: 2;
  font-family: 'Helvetica Neue', Arial, sans-serif;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 2px;
  background-color: #ffffff;
}
.linter-highlight.status-info {
  color: #3f51b5;
}
.linter-highlight.status-success {
  color: #4caf50;
}
.linter-highlight.status-warning {
  color: #ef6c00;
}
.linter-highlight.status-error {
  color: #f44336;
}
.list-group li {
  padding-left: 2.5px;
}
.list-group li.selected {
  color: #ffffff;
  background-color: #f0544c;
}
.list-group li.selected:before {
  display: none;
}
.list-tree .selected {
  color: #ffffff;
}
.select-list li {
  padding: 2.5px 5px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 2.5px;
  border-radius: 2px;
  background-color: #eeeeee;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 2.5px;
}
.select-list.popover-list .list-group li {
  padding-left: 2.5px;
}
.panel-heading {
  border-bottom: 1px solid rgba(0, 0, 0, 0.22);
  background-color: #eeeeee;
}
.inset-panel {
  background-color: #eeeeee;
}
.inset-panel .panel-heading {
  background-color: #f8f8f8;
}
atom-panel.modal {
  border: 1px solid rgba(0, 0, 0, 0.22);
  border-top: none;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.ui-site-1 {
  background-color: #3f51b5;
}
.ui-site-2 {
  background-color: #4caf50;
}
.ui-site-3 {
  background-color: #ef6c00;
}
.ui-site-4 {
  background-color: #673ab7;
}
.ui-site-5 {
  background-color: #f44336;
}
.status-bar {
  font-size: 12px;
  color: #555555;
  border-top: 1px solid rgba(0, 0, 0, 0.22);
  background-color: #ffffff;
}
.tab-bar {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  position: relative;
  background-color: #eeeeee;
}
.tab-bar .tab {
  display: block;
  flex: auto;
  position: relative;
  max-width: none;
  text-align: center;
  color: #999999;
  height: 35px;
  line-height: 35px;
  font-size: 12px;
  background-color: transparent;
  border-left: 1px solid transparent;
  border-right: 1px solid transparent;
  border-bottom: 1px solid rgba(0, 0, 0, 0.22);
}
.tab-bar .tab.active {
  color: #555555;
  background-color: #eeeeee;
  border-color: rgba(0, 0, 0, 0.22);
  border-bottom: 1px solid transparent;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 50%;
  right: 9px;
  margin-top: -3px;
  border-color: #ef6c00;
}
.tab-bar .tab.modified:hover .close-icon {
  color: currentColor;
}
.tab-bar .tab .close-icon:hover {
  color: #555555;
}
.tab-bar .tab.active .close-icon:hover {
  color: #555555;
}
.tab-bar .tab.is-dragging {
  background: rgba(0, 0, 0, 0);
  border-color: transparent;
  opacity: .5;
}
.tab-bar .tab.is-dragging .close-icon {
  visibility: hidden;
}
.text-smaller {
  font-size: smaller;
}
.text-subtle {
  color: #999999;
}
.text-highlight {
  color: #333333;
}
.text-info {
  color: #555555;
}
.text-success {
  color: #555555;
}
.text-warning {
  color: #555555;
}
.text-error {
  color: #555555;
}
.highlight {
  padding: 1px 4px;
  color: #333333;
  border-radius: 2px;
  background-color: #eeeeee;
}
.highlight-info {
  padding: 1px 4px;
  color: #333333;
  border-radius: 2px;
  background-color: #03a9f4;
}
.highlight-warning {
  padding: 1px 4px;
  color: #333333;
  border-radius: 2px;
  background-color: #ef6c00;
}
.highlight-error {
  padding: 1px 4px;
  color: #333333;
  border-radius: 2px;
  background-color: #f44336;
}
.highlight-success {
  padding: 1px 4px;
  color: #333333;
  border-radius: 2px;
  background-color: #4caf50;
}
.background-message {
  font-weight: bold;
  color: #999999;
}
.tooltip .tooltip-inner {
  line-height: 1;
  padding: .75em;
  white-space: nowrap;
  max-width: none;
}
.tooltip .keystroke {
  padding: .15em .4em;
  margin: 0 -0.3em 0 0.25em;
  border-radius: 2px;
  color: #ffffff;
  background: #f0544c;
}
.tree-view-resizer {
  border-right: 1px solid rgba(0, 0, 0, 0.22);
}
.tree-view {
  color: #555555;
  background-color: #ffffff;
}
.tree-view .list-item {
  color: #555555;
}
.tree-view .file.selected,
.tree-view .directory.selected > .header {
  color: #ffffff;
}
